//SPDX-License-Identifier: UNLICENSE
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import "./AcceptanceVoting.sol";

contract Institution {

  enum institutionState {
    APPROVED, //approved after vote
    PENDING, //pending voting
    REJECTED //rejected after vote
  }

  struct institution {
    string name;
    string country;
    string city;
    string latitude;
    string longitude;
    institutionState state;
    address owner;
  }

  event add_institution(
    address inst,
    string name,
    institutionState state,
    uint256 id
  );
  event approve_institution(address inst, string name, institutionState state);

  uint256 public numInstitutions = 0;
  mapping(uint256 => institution) public institutions;
  address _owner;

  AcceptanceVoting acceptanceVotingContract;

  constructor(AcceptanceVoting acceptanceVotingAddr) public {
    _owner = msg.sender;
    acceptanceVotingContract = acceptanceVotingAddr;
  }

  /**
    @dev Require contract owner only
   */
  modifier ownerOnly() {
    _;
  }

  /**
    @dev Require that the institution has been voted on
   */
  modifier votedOnly() {
    _;
  }

  modifier validInstitutionId(uint256 instId) {
    require(instId < numInstitutions, "The institution id is not valid");
    _;
  }

  /**
    @dev Create an institution
    @param newInstitution The address of the institution to be added
    @param institutionName The name of the institution to be added
    @return instId The id of the institution that was added
   */
  function addInstitution(
    address newInstitution,
    string memory institutionName
  ) public ownerOnly returns (uint256 instId) {
    // Dummy code just to enable testing of credential functions
    institution memory newInst = institution(
      institutionName,
      "Singapore",
      "Singapore",
      "1.290270",
      "103.851959",
      institutionState.PENDING,
      newInstitution
    );
    // newInst.name = institutionName;
    // newInst.state = institutionState.PENDING;
    // newInst.owner = newInstitution;

    uint256 newInstitutionId = numInstitutions++;
    institutions[newInstitutionId] = newInst; // commit to state variable

    acceptanceVotingContract.addApplicant(newInstitutionId, msg.sender, institutionName);

    emit add_institution(
      institutions[newInstitutionId].owner,
      institutions[newInstitutionId].name,
      institutions[newInstitutionId].state,
      newInstitutionId
    );

    return newInstitutionId;
  }

  /**
    @dev Delete an institution
    @param instId The id of the institution to delete
   */
  function deleteInstitution(uint256 instId) public ownerOnly {}

  /**
    @dev Approve an institution
    @param instId The id of the institution to approve
   */
  function approveInstitution(uint256 instId) public votedOnly {
    // Dummy code just to enable testing of credential functions
    bool approvalResult = acceptanceVotingContract.checkApproved(instId);
    bool votingConcluded = acceptanceVotingContract.checkConcluded(instId);

    if (approvalResult == true) {
      institutions[instId].state = institutionState.APPROVED;
      
      emit approve_institution(
        institutions[instId].owner,
        institutions[instId].name,
        institutions[instId].state
      );
    } else if ((approvalResult != true) && (votingConcluded == true)) {
      institutions[instId].state = institutionState.REJECTED;
    } else {
      institutions[instId].state = institutionState.PENDING;
    }
    

  }

  //Getters
  function getInstitutionName(
    uint256 instId
  ) public view validInstitutionId(instId) returns (string memory) {
    return institutions[instId].name;
  }

  function getInstitutionCountry(
    uint256 instId
  ) public view validInstitutionId(instId) returns (string memory) {
    return institutions[instId].country;
  }

  function getInstitutionCity(
    uint256 instId
  ) public view validInstitutionId(instId) returns (string memory) {
    return institutions[instId].city;
  }

  function getInstitutionLatitude(
    uint256 instId
  ) public view validInstitutionId(instId) returns (string memory) {
    return institutions[instId].latitude;
  }

  function getInstitutionLongitude(
    uint256 instId
  ) public view validInstitutionId(instId) returns (string memory) {
    return institutions[instId].longitude;
  }

  function getInstitutionState(
    uint256 instId
  ) public view validInstitutionId(instId) returns (institutionState) {
    return institutions[instId].state;
  }

  function getInstitutionOwner(
    uint256 instId
  ) public view validInstitutionId(instId) returns (address) {
    return institutions[instId].owner;
  }
}

contracts/AcceptanceVoting.sol.content:
pragma solidity ^0.5.0;

contract AcceptanceVoting {

  enum VotingState {
    OPEN,
    CLOSED
  }

  //List of committee members, chairman is part of committee members
  address[] committeeMembers;

  // member address => true if exist
  mapping(address => bool) isCommitteeMember;

  // applicantId => applicant address
  mapping(uint256 => address) applicantAddress;

  // applicantId => applicant name
  mapping(uint256 => string) applicantName;

  // members => applicant => true if voted
  mapping(address => mapping(uint256 => bool)) hasVoted;

  // applicant => votes it got
  mapping(uint256 => uint256) applicantVoteScore;

  // applicant => voting status
  mapping(uint256 => VotingState) applicantVotingState;

  // applicant => vote open block number
  mapping(uint256 => uint256) applicantVoteOpenBlock;

  // applicant => vote result status
  mapping(uint256 => bool) isApproved;

  // applicant => voting ended
  mapping(uint256 => bool) isConcluded;

  // application fee in wei
  uint256 applicationFee;
  //Size of commitee
  //uint32 committeeSize;

  //Address of committee chariman
  address committeeChairman;
  // should we set a deadline to vote e.g. 1 week
  // Deadline in terms of blocks (1 eth block roughly 12.13 minutes)
  // applicant => vote deadline for committee to vote for that applicant
  uint256 votingTimeframe;

  // applicant => voting state for that applicant
  mapping(uint256 => VotingState) currentState;

  //Events
  event new_chairman(address newChairman);
  event new_committee_member(address newCommitteeMember);
  //event new_committee_size(uint256 size);
  event voted(
    address committeeMember,
    uint256 applicantNumber,
    uint256 voteScore
  );
  event vote_open(uint256 applicantNumber, uint256 blockNumber);
  event vote_close(uint256 applicantNumber, uint256 blockNumber);
  event vote_results(
    string outcome,
    uint256 applicantNumber,
    uint256 applicantScore,
    uint256 scoreNeeded
  );

  // should the person who deploys the contract be the chairman?
  // or should we allocate the chairman
  constructor(uint256 fee, uint256 voteDuration) public {
    committeeChairman = msg.sender;
    applicationFee = fee;
    votingTimeframe = voteDuration;
    //addCommitteeMember(msg.sender);
  }

  modifier isChairman() {
    require(
      msg.sender == committeeChairman,
      "Only Chairman can call this function"
    );
    _;
  }

  function addApplicant (
    uint256 institutionID, 
    address institutionAddress,
    string calldata institutionName
    ) external {
    applicantAddress[institutionID] = institutionAddress;
    applicantName[institutionID] = institutionName;
  }

  function getApplicantName(uint256 applicantNumber) external view returns (string memory) {
    return applicantName[applicantNumber];
  }

  function checkApproved(uint256 applicantNumber) external view returns (bool) {
    return isApproved[applicantNumber];
  }

  function checkConcluded(uint256 applicantNumber) external view returns (bool) {
    return isConcluded[applicantNumber];
  }

  function vote(
    uint256 applicantNumber,
    bool hasPhyiscalPremise,
    bool hasWebPresence,
    bool hasResearch,
    bool hasAwards,
    bool hasStudentMarketing
  ) external {
    require(isCommitteeMember[msg.sender], "You are not a committee member");
    require(
      applicantVotingState[applicantNumber] == VotingState.OPEN,
      "applicant not open for voting"
    );
    hasVoted[msg.sender][applicantNumber] = true;

    // Do voting calculation
    uint256 vote_score = 0;
    if (hasPhyiscalPremise) {
      vote_score++;
    }
    if (hasWebPresence) {
      vote_score++;
    }
    if (hasResearch) {
      vote_score++;
    }
    if (hasAwards) {
      vote_score++;
    }
    if (hasStudentMarketing) {
      vote_score++;
    }

    // Add committee member vote score to total vote score
    applicantVoteScore[applicantNumber] += vote_score;

    emit voted(msg.sender, applicantNumber, vote_score);
  }

  function openVote(uint256 applicantNumber) external isChairman {
    require(
      applicantVotingState[applicantNumber] == VotingState.CLOSED,
      "applicant already undergoing voting"
    );

    // Change voting state
    applicantVotingState[applicantNumber] = VotingState.OPEN;

    // Write vote open block
    applicantVoteOpenBlock[applicantNumber] = block.number;

    // Emit event
    emit vote_open(applicantNumber, block.number);
  }

  function closeVote(
    uint256 applicantNumber,
    uint256 scoreNeeded
  ) external isChairman {
    require(currentState[applicantNumber] == VotingState.OPEN, "Vote is not open");
    //require(
    //  applicantVoteOpenBlock[applicantNumber] + votingTimeframe >= block.number,
    //  "Deadline not up"
    //);

    // Calculate votes here
    if (applicantVoteScore[applicantNumber] >= scoreNeeded) {
      isApproved[applicantNumber] = true;
      emit vote_results(
        "Accepted",
        applicantNumber,
        applicantVoteScore[applicantNumber],
        scoreNeeded
      );
      addCommitteeMember(applicantAddress[applicantNumber]);
    } else if (applicantVoteScore[applicantNumber] < scoreNeeded) {
      emit vote_results(
        "Not accepted",
        applicantNumber,
        applicantVoteScore[applicantNumber],
        scoreNeeded
      );
    }

    isConcluded[applicantNumber] = true;
    //distributeFee();

    emit vote_close(applicantNumber, block.number);
  }

  function distributeFee() external payable {
    // Divide the application fee equally among all committee members
    uint256 val = applicationFee / committeeMembers.length;
    for (uint256 i = 0; i < committeeMembers.length; i++) {
      address payable recipient = address(uint160(committeeMembers[i]));
      recipient.transfer(val);
    }
  }

  // getters
  function getCommitteeChairman() external view returns (address) {
    return committeeChairman;
  }

  function getvotingTimeframe() external view returns (uint256) {
    return votingTimeframe;
  }

  // will return the index of the voting state
  // i.e. VotingState.OPEN == 0
  function getVotingState(uint256 applicantNumber) external view returns (VotingState) {
    return currentState[applicantNumber];
  }

  function getFee() public view returns (uint256) {
    return applicationFee;
  }

  function getDeadline() public view returns (uint256) {
    return votingTimeframe;
  }

  function getCommitteeMembers() public view returns (address[] memory) {
    return committeeMembers;
  }

  function changeDeadline(uint256 votingDuration) public isChairman {
    votingTimeframe = votingDuration;
  }

  function changeFee(uint256 fee) public isChairman {
    applicationFee = fee;
  }

  /*
  function changeCommitteeSize(uint32 size) public isChairman {
    committeeSize = size;
    emit new_committee_size(size);
  }
  */
  function removeCommiteeMember(address user) public isChairman {
    require(isCommitteeMember[user], "User is not a current committee Member");
    require(committeeMembers.length > 0, "Commitee is empty");
    isCommitteeMember[user] = false;

    // Remove address from committee member array without preserving order
    for (uint256 i = 0; i < committeeMembers.length; i++) {
      if (user == committeeMembers[i]) {
        // Replace current index with last element
        committeeMembers[i] = committeeMembers[committeeMembers.length - 1];
        // Pop last element
        committeeMembers.pop();
      }
    }
  }

  function addCommitteeMember(address user) public isChairman {
    //require(
    //  committeeMembers.length < committeeSize,
    //  "Max committee Members size"
    //);
    committeeMembers.push(user);
    isCommitteeMember[user] = true;
    emit new_committee_member(user);
  }

  function changeChairman(address user) public isChairman {
    committeeChairman = user;
    emit new_chairman(user);
  }
}

